ReactDOM.render(element, document.body);

function TodoItem(props) {
	return (
		<li>
			<span>
				<FontAwesomeIcon
					icon={faCircleCheck}
					size="2xs"
					style={{ color: '#63E6BE' }}
				/>
			</span>
			<p>{props.text}</p>
			<span>‚ùå</span>
		</li>
	);
}
export { TodoItem };
